import React from "react";

export default function Header() {
  const headerStyle = {
    background: "linear-gradient(135deg, #ff7e5f, #feb47b)", // warm gradient
    color: "#fff",
    padding: "12px 20px",
    textAlign: "center",
    fontSize: "22px",
    fontWeight: "700",
    borderRadius: "0 0 15px 15px",
    boxShadow: "0 4px 10px rgba(0,0,0,0.2)",
    position: "relative",
    overflow: "hidden",
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
  };

  const subTextStyle = {
    fontSize: "14px",
    fontWeight: "400",
    marginTop: "5px",
    color: "#fff3",
  };

  const taglineStyle = {
    fontSize: "12px",
    marginTop: "2px",
    color: "#fff5",
  };

  return (
    <header style={headerStyle}>
      My Freelance Platform
      <div style={subTextStyle}>Where projects meet talent</div>
      <div style={taglineStyle}>Discover opportunities and grow your career</div>
    </header>
  );
}
